    'featured_listings.AdditionalTermsForFeaturedAds': 'Esilet\xF5stetud kuulutuste lisatingimused',
    'featured_listings.AdditionalTermsForFeaturedAds_content': 'K\xE4esolevad lisatingimused, mis kehtivad lisaks veebisaidi <<LINK_TERMS_USE>>kasutustingimustele<</LINK_TERMS_USE>>, h\xF5lmavad esilet\xF5stetud kuulutuste kasutamist:<br /><ul><li>Esilet\xF5stetud kuulutuse eest maksmise t\xF5endusena v\xE4ljastab OLX ainult maksmisprotseduuri l\xF5pus kuvatava tellimuse kinnituse ja e-posti teel saadetud kinnituse.</li><li>Kui Teie kuulutust pole kas tehnilisel v\xF5i mis tahes muul p\xF5hjusel esilet\xF5stetud kuulutuste rubriigis n\xE4ha, on OLXi ainus kohustus paigutada Teie kuulutus v\xF5imalikult kiiresti esilet\xF5stetud kuulutuste rubriiki.</li><li>Arvetega tegeleb kolmanda osapoolena tegutsev teenusepakkuja.</li><li>OLXi \xE4ran\xE4gemisel ei avaldata \xFChtki kuulutust, mis on sisult solvav, pornograafiline, sisaldab r\xE4mpsposti (k.a dubleerivaid kuulutusi), potentsiaalset pettust v\xF5i mis v\xF5ib rikkuda autori\xF5igusi. Selliste kuulutuste eest  makstud raha ei tagastata.</li><li>K\xD5NEALUST ESILET\xD5STETUD KUULUTUSTE TEENUST PAKUTAKSE  SELLISENA, NAGU SEE ON V\xD5I SELLISENA, NAGU TEENUS ON SAADAVAL, ILMA MIS TAHES  GARANTIIDETA, \xD5IGUSAKTIDEGA MAKSIMAALSELT LUBATUD PIIRES.  OLX EI ANNA MINGEID SELLEKOHASEID GARANTIISID EGA ESINDUS\xD5IGUST, SAMUTI EI V\xD5TA VASTUTUST ESILET\xD5STETUD KUULUTUSTE TEENUSE KAUDU AVALDATUD SISU T\xC4PSUSE V\xD5I T\xC4IELIKKUSE EEST.</li></ul>',
