    'featured_listings.HowDoesItWork': 'Kuidas see toimib?',
    'featured_listings.HowDoesItWork_New': 'Kuulutuste loendi alguses ja otsingutulemustes esilet\xF5stetud kuulutuste puhul n\xE4idatakse esilet\xF5stetud kuulutusi vastavas alamkategoorias ning kuulutused roteeruvad juhuslikus j\xE4rjestuses koos k\xF5ikide selles alamkategoorias ja asukohas avaldatud kuulutustega. K\xF5ikidel juhtudel valitakse esilet\xF5stetud kuulutus juhuslikkuse p\xF5him\xF5ttel, et k\xF5ikidel esilet\xF5stetud kuulutuste ostjatel oleks v\xF5rdne v\xF5imalus olla veebisaidil n\xE4htav. Seep\xE4rast on v\xF5imalik, et Teie kuulutust pole k\xF5nealuses esilet\xF5stetud kuulutuste rubriigis alati n\xE4ha.',
    'featured_listings.HowDoIBuyAFeaturedListing': 'Kuidas osta esilet\xF5stetud kuulutust?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': 'Esilet\xF5stetud kuulutust saab osta postitamisprotsessi viimases etapis, kui antakse kinnitus Teie kuulutuse avaldamise kohta, aga ka Minu OLXist. Toiming on lihtne. Valite, mitme n\xE4dala jooksul soovite kuulutust esile t\xF5sta. Seej\xE4rel avaneb mitmete maksev\xF5imalustega maksete lehek\xFClg. P\xE4rast makse tegemist saate kinnituse selle kohta, et Teie kuulutus on valitud ajavahemikul n\xE4htav. Kui Teie kuulutus vastab OLXi kasutustingimustele, saate e-kirjaga sellekohase kinnituse. Palume silmas pidada, et p\xE4rast esilet\xF5stetud kuulutuse ostu raha tagastamise v\xF5imalust pole. Esilet\xF5stetud kuulutuse m\xFC\xFCk on l\xF5plik.',
