    'featured_listings.HowMuchVisitsWillIncrease': 'Mil m\xE4\xE4ral suureneb minu kuulutuse k\xFClastatavus?',
    'featured_listings.HowMuchVisitsWillIncrease_content': 'Esilet\xF5stetud kuulutuste eesm\xE4rk on suurendada Teie kuulutuse potentsiaalset n\xE4htavust. Teie kuulutust n\xE4eb esilet\xF5stetuna keskmiselt 8 korda rohkem k\xFClastajaid, v\xF5rreldes tavakuulutustega*. Suurima kuulutuste arvuga kategooriates v\xF5ib n\xE4htavus suureneda isegi 20 korda.*',
